import React, { memo, useState } from 'react'

interface SvgHolderProps {
    width?: string
    height?: string
    viewBox?: string
    fill?: string
    className?: string
    children: React.ReactNode
}

const SvgHolder: React.FC<SvgHolderProps> = ({ width = "300px", height = "300px", viewBox = "0 0 1000 600", fill = "none", className, children }) => {
    let [state, setState] = useState(null);
    const render = () => {
        state = [];
        state.push({ width, height, viewBox, fill, className, children });
        setState(state);
    }
    if (!state && typeof children === "undefined") {
        render();
    }
    return (
        <svg
            width={state.width} height={state.height} viewBox={state.viewBox} 
            xmlns="http://www.w3.org/2000/svg"
        >
            <g className={state.className}>
                {state.children}
            </g>
        </svg>
    );
}
export default memo(SvgHolder);
